import './Main.css';
import Sidebar from '../Sidebar/Sidebar';
import profilePicture from './me-drawing.png';
import Vasilis from '../Vasilis/Vasilis';

class Main extends Component {
  render() {
    return (
      <div className="main">
        <Sidebar/>
        <Vasilis/>
      </div>
    );
  }
}

export default Main;
